{
  "translationLines": [
    {
      "lineNumber": 178561,
      "originalJapaneseLine": "「魔軍の本拠地と、危険な火山、ね……",
      "translatedEnglishLine": "\"The Demon Army's main base and a dangerous volcano, huh...\""
    },
    {
      "lineNumber": 178562,
      "originalJapaneseLine": "　どっちにしてもあんま変わらんな」",
      "translatedEnglishLine": " \"Either way, it's not much different.\""
    },
    {
      "lineNumber": 178563,
      "originalJapaneseLine": "マリアが望遠鏡でタンザモンザツリーを覗いていた。",
      "translatedEnglishLine": "Maria was looking at the Tanzamonza Tree through a telescope."
    },
    {
      "lineNumber": 178564,
      "originalJapaneseLine": "「うーん、覚悟していたけど、",
      "translatedEnglishLine": "\"Hmm, I was prepared for this, but,"
    },
    {
      "lineNumber": 178565,
      "originalJapaneseLine": "　やっぱりここからじゃケイブリスが",
      "translatedEnglishLine": " after all, from here, I can't tell whether Cavelice is"
    },
    {
      "lineNumber": 178566,
      "originalJapaneseLine": "　いるかどうかなんて分からないわ……」",
      "translatedEnglishLine": " here or not...\""
    },
    {
      "lineNumber": 178567,
      "originalJapaneseLine": "「だろうな」",
      "translatedEnglishLine": "\"I thought so.\""
    },
    {
      "lineNumber": 178568,
      "originalJapaneseLine": "「むしろ、ここに長居すると、",
      "translatedEnglishLine": "\"Rather, if we stay here too long,"
    },
    {
      "lineNumber": 178569,
      "originalJapaneseLine": "　いずれ見つかりそうだ」",
      "translatedEnglishLine": " we'll probably get found eventually.\""
    },
    {
      "lineNumber": 178570,
      "originalJapaneseLine": "「おい、かなみ。",
      "translatedEnglishLine": "\"Hey, Kanami."
    },
    {
      "lineNumber": 178571,
      "originalJapaneseLine": "　隠密のプロだろう。",
      "translatedEnglishLine": " You're a stealth expert, right?"
    },
    {
      "lineNumber": 178572,
      "originalJapaneseLine": "　こういうときどうするもんなんだ？」",
      "translatedEnglishLine": " What do we do in a situation like this?\""
    },
    {
      "lineNumber": 178573,
      "originalJapaneseLine": "「そうね……",
      "translatedEnglishLine": "\"Well... "
    },
    {
      "lineNumber": 178574,
      "originalJapaneseLine": "　まずセオリー通りなら――」",
      "translatedEnglishLine": " first, according to the theory――\""
    },
    {
      "lineNumber": 178575,
      "originalJapaneseLine": "「――ッ！」",
      "translatedEnglishLine": "\"――!\""
    },
    {
      "lineNumber": 178576,
      "originalJapaneseLine": "「みんな、隠れて！",
      "translatedEnglishLine": "\"Everyone, hide!"
    },
    {
      "lineNumber": 178577,
      "originalJapaneseLine": "　魔物の気配よ！」",
      "translatedEnglishLine": " There's a presence of monsters!\""
    },
    {
      "lineNumber": 178578,
      "originalJapaneseLine": "かなみの言葉通り、",
      "translatedEnglishLine": "Just as Kanami said,"
    },
    {
      "lineNumber": 178579,
      "originalJapaneseLine": "魔物の部隊がランス達のいる場所に",
      "translatedEnglishLine": "a squad of monsters was seen approaching"
    },
    {
      "lineNumber": 178580,
      "originalJapaneseLine": "近づこうとしているのが見えた。",
      "translatedEnglishLine": "the place where Rance and his group were."
    },
    {
      "lineNumber": 178581,
      "originalJapaneseLine": "「む……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 178582,
      "originalJapaneseLine": "「よーし、なんとか倒したぞ」",
      "translatedEnglishLine": "\"Alright, we managed to take them down.\""
    },
    {
      "lineNumber": 178583,
      "originalJapaneseLine": "「こらー！　そもそも戦闘なんて",
      "translatedEnglishLine": "\"Hey! There was no need to fight in the first place!\""
    },
    {
      "lineNumber": 178584,
      "originalJapaneseLine": "　する必要ないじゃない！」",
      "translatedEnglishLine": "\"We didn't have to fight at all!\""
    },
    {
      "lineNumber": 178585,
      "originalJapaneseLine": "「隠れてって言ったんだから、",
      "translatedEnglishLine": "\"I told you to hide,"
    },
    {
      "lineNumber": 178586,
      "originalJapaneseLine": "　ちゃんと言うこと聞いてよー！」",
      "translatedEnglishLine": " so listen properly!\""
    },
    {
      "lineNumber": 178587,
      "originalJapaneseLine": "「がははは、敵は見逃さないのが俺様だ」",
      "translatedEnglishLine": "\"Gahaha, I'm the type who never lets enemies escape.\""
    },
    {
      "lineNumber": 178588,
      "originalJapaneseLine": "「それに、生け捕りに出来れば、",
      "translatedEnglishLine": "\"Besides, if we can capture them alive,"
    },
    {
      "lineNumber": 178589,
      "originalJapaneseLine": "　色々と便利かも知れないぞ？」",
      "translatedEnglishLine": " it could be useful in many ways, you know?\""
    },
    {
      "lineNumber": 178590,
      "originalJapaneseLine": "「というわけで、生き残りはいないか？",
      "translatedEnglishLine": "\"So, is there anyone alive?"
    },
    {
      "lineNumber": 178591,
      "originalJapaneseLine": "　いたら拷問にかけて情報を吐かせて――」",
      "translatedEnglishLine": " If there are, we'll torture them for information――\""
    },
    {
      "lineNumber": 178592,
      "originalJapaneseLine": "「ひ、ひーーっ！",
      "translatedEnglishLine": "\"Eek, eek—!"
    },
    {
      "lineNumber": 178593,
      "originalJapaneseLine": "　なんで人間がこんなところにいるんだよー！」",
      "translatedEnglishLine": " Why are humans even here?!\""
    },
    {
      "lineNumber": 178594,
      "originalJapaneseLine": "「げっ！？",
      "translatedEnglishLine": "\"Gah!?\""
    },
    {
      "lineNumber": 178595,
      "originalJapaneseLine": "魔物の死体が山と積まれている場所から、",
      "translatedEnglishLine": "From the place where a mountain of monster corpses lay,"
    },
    {
      "lineNumber": 178596,
      "originalJapaneseLine": "死体に紛していた魔物が飛び出した。",
      "translatedEnglishLine": "a monster hiding among the corpses jumped out."
    },
    {
      "lineNumber": 178597,
      "originalJapaneseLine": "「うわ、速っ！",
      "translatedEnglishLine": "\"Whoa, fast!"
    },
    {
      "lineNumber": 178598,
      "originalJapaneseLine": "　追え、かなみ！　逃すな！」",
      "translatedEnglishLine": " Chase it, Kanami! Don't let it escape!\""
    },
    {
      "lineNumber": 178599,
      "originalJapaneseLine": "結局、ランス達はタンザモンザツリーを",
      "translatedEnglishLine": "In the end, Rance and the others"
    },
    {
      "lineNumber": 178600,
      "originalJapaneseLine": "目指して逃げる魔物を逃してしまった。",
      "translatedEnglishLine": "failed to catch the monster escaping toward the Tanzamonza Tree."
    },
    {
      "lineNumber": 178601,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "…………"
    },
    {
      "lineNumber": 178602,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "……"
    },
    {
      "lineNumber": 178603,
      "originalJapaneseLine": "一時間後――",
      "translatedEnglishLine": "One hour later――"
    },
    {
      "lineNumber": 178604,
      "originalJapaneseLine": "「はあ、はあ、くそっ！",
      "translatedEnglishLine": "\"Hah, hah, damn it!"
    },
    {
      "lineNumber": 178605,
      "originalJapaneseLine": "　こんなことになるなんて！」",
      "translatedEnglishLine": " I can't believe this is happening!\""
    },
    {
      "lineNumber": 178606,
      "originalJapaneseLine": "タンザモンザツリーにいる魔物達に",
      "translatedEnglishLine": "The monsters at the Tanzamonza Tree"
    },
    {
      "lineNumber": 178607,
      "originalJapaneseLine": "侵入がバレてしまったランス達は、",
      "translatedEnglishLine": "discovered Rance and his group’s intrusion,"
    },
    {
      "lineNumber": 178608,
      "originalJapaneseLine": "多数の魔物部隊に森の中を追われていた。",
      "translatedEnglishLine": "and they were being chased through the forest by numerous monster squads."
    },
    {
      "lineNumber": 178609,
      "originalJapaneseLine": "「逃すな！　必ずや見つけ出してブッ殺せ！」",
      "translatedEnglishLine": "\"Don't let them escape! Find them and kill them for sure!\""
    },
    {
      "lineNumber": 178610,
      "originalJapaneseLine": "森の至るところから",
      "translatedEnglishLine": "From all over the forest"
    },
    {
      "lineNumber": 178611,
      "originalJapaneseLine": "魔物の暴力的で下卑た声が響く。",
      "translatedEnglishLine": "violent and vulgar monster voices echoed."
    },
    {
      "lineNumber": 178612,
      "originalJapaneseLine": "「こちらは数千の部隊で行くのだ！",
      "translatedEnglishLine": "\"We'll go with thousands of troops!"
    },
    {
      "lineNumber": 178613,
      "originalJapaneseLine": "　人間がどれだけ強かろうと恐れるなァ！」",
      "translatedEnglishLine": " No matter how strong humans are, don't fear them!\""
    },
    {
      "lineNumber": 178614,
      "originalJapaneseLine": "「ひゃははは！　女だ女だ！",
      "translatedEnglishLine": "\"Hyahaha! Women, women!"
    },
    {
      "lineNumber": 178615,
      "originalJapaneseLine": "　女は生け捕りにしろォォォ！」",
      "translatedEnglishLine": " Capture the women alive!\""
    },
    {
      "lineNumber": 178616,
      "originalJapaneseLine": "「くそ、くそ、くそ！",
      "translatedEnglishLine": "\"Damn it, damn it, damn it!"
    },
    {
      "lineNumber": 178617,
      "originalJapaneseLine": "　俺様が仲間の女の子を見捨てることになるとは！」",
      "translatedEnglishLine": " I can't believe I'll have to abandon my female comrades!\""
    },
    {
      "lineNumber": 178618,
      "originalJapaneseLine": "ランスの部隊にいた女の子数人は",
      "translatedEnglishLine": "Several girls in Rance's squad"
    },
    {
      "lineNumber": 178619,
      "originalJapaneseLine": "既に逃げる途中で森の中で倒れていた。",
      "translatedEnglishLine": "had already collapsed in the forest while fleeing."
    },
    {
      "lineNumber": 178620,
      "originalJapaneseLine": "「とにかく真っ直ぐ走って！」",
      "translatedEnglishLine": "\"Just run straight ahead!\""
    }
  ]
}

